//index.html->index.js->App.js->Footer.js

import React from "react";
import { Container, Row, Col } from "react-bootstrap";

function Footer() {
  return (
    <div>
      <footer>
        <Container>
          <Row>
            <Col className="text-center py-3">Copyright 2022</Col>
          </Row>
        </Container>
      </footer>
    </div>
  );
}

export default Footer;
